    false,nt"url": null,nt"notes": "NODC Accession 0114241 includes site samples
    and biological data collected aboard the ALPHA HELIX during cruises HX242, HX244,
    HX247, HX271 and HX275 in the Gulf of Alaska from 2001-04-18 to 2003-08-10. These
    data include CHLOROPHYLL A, growth rate and graze rate (or grazing rate). The instruments
    used to collect these data include bottle. These data were collected by Suzanne
    Strom of Western Washington University as part of NEP. The Biological and Chemical
    Oceanography Data Management Office (BCO-DMO) submitted these data to NODC on 2013-10-30.nnThe
    following is the text of the abstract provided by BCO-DMO:nnPhytoplankton Growth
    Rates in the coastal Gulf of AlaskanPhytoplankton growth rates, the phytoplankton
    growth rate response to nutrient enrichment, and microzooplankton grazing rates
    on phytoplankton in three different size classes were measured during three cruises
    to the coastal Gulf of Alaska in 2001.nnSuzanne L. StromnWestern Washington UniversitynShannon
    Point Marine Centern1900 Shannon Point RoadnAnacortes, WA 98221-4042nstroms@cc.wwu.edu
